Teaser:
Jalankan program C/C++ anda dalam ChATGPT menggunakan gesaan ini. Ini adalah gesaan yang sangat kuat untuk menjalankan semua jenis bahasa pengekodan terus dalam pelayar web anda menggunakan Chatgpt.

 Hanya taip kod C atau C++ anda yang anda mahu jalankan dalam gesaan dan Chat-GPT akan memberikan anda output program itu sebagai tindak balas.

 Ini berguna jika anda tidak memasang pengkompil dalam PC anda dan ingin menguji beberapa kod sekarang anda boleh melakukannya dengan gesaan mudah.

 Contoh untuk kod C++.
 #include <Istream>

